import React,{useState, useCallback} from 'react';
import MySurvey from '../surveyTypes/suveryTypeOne';

const SurveyOne = () => {
    //shows the comepleted page
    const [showPage, setShowPage] = useState(true);
    const onCompletePage = ((data)=>{
        console.log(data);
        setShowPage(!showPage)
    },[showPage])

    //the custom final page
    const setFinalPage = () =>{
        return(
            <main>
                <h1>
                    Thank you for taking the survey!
                </h1>
            </main>
        )
    }
    return(
        //<MySurvey showCompletedPage={data=>onCompletePage(data)}/>
        <div>
            {
                showPage?
                <MySurvey showCompletedPage={data=>onCompletePage(data)} />:
                setFinalPage()
            }
        </div>
    )
}

export default SurveyOne;
